import React from "react";
import TableBody from "./TableBody";
import TableHead from "./TableHead";

const Table = () => {
   return (
      <table style={{ borderCollapse: "collapse", border: "1px solid black" }}>
         <TableHead />
         <TableBody />
      </table>
   );
};

export default Table;
